  //   { id: 3, quantity: "3", name: "Sugar", isChecked: false },
  // ];

  // const handleDelete = (itemId) => {
  //   console.log(`Deleting item with ID: ${itemId}`);
  // };

  return (
    <div id="myUnOrdList">
      <ul className="todo-list">
        {items.map((item) => (
          <TodoItem itemList={item} key={item.id} />
        ))}
      </ul>
    </div>
  );
}

export default TodoList;
